import React from "react";

const Copia = () => {
  return (
    <div>
      <html>
        <head>
          <title>Copia de seguridad de MongoDB</title>
        </head>
        <body>
          <h1>Copia de seguridad de MongoDB</h1>
          <button id="backupButton">Crear copia de seguridad</button>
          <script src="app.js"></script>
        </body>
      </html>
    </div>
  );
};

export default Copia;
